import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
      <Hero />
      <main>
        <CardList />
        <ActivityFeed />
      </main>
      <Footer />
    </div>
  );
}

function Header() {
  return (
    <header className="header">
      <div className="header__logo">Logo</div>
      <div className="header__right">
        <input className="search" placeholder="Search..." />
        <p className="lastPressed">+ UPLOAD</p>
        <img className="Mohan" src="./public/Images/Mohan-murge.jpg" />
      </div>
    </header>
  );
}

export default App;
